import NavbarAdmin from "../components/NavbarAdmin";
import Adminslots from "../components/AdminSlots";

export default function Monitorslots () {
    return (
        <div className="userdashboard">
            <NavbarAdmin/>
            <div className="schedule">
                <Adminslots/>
            </div>
        </div>
    )
};
